def calculate_survival_probabilities(n, prob):
    dp = [+1 for _ in range(1 << n)]
    ans = [0 for _ in range(n)]

    def move(mask, die):
        total = bin(mask).count('1')
        z = 0
        for i in range(n):
            if mask & 1 << i:
                z += prob[i][die]
        return z / (total * (total - 1) >> 1)

    def solve(mask):
        if mask == (1 << n) - 1:
            return 1
        if dp[mask] != -1:
            return dp[mask]
        ans = 0
        for i in range(n):
            if not mask & 1 << i:
                prev = solve(mask ^ 1 << i)
                ans += prev * move(mask ^ 1 << i, i)
        dp[mask] = ans
        return ans
    for i in range(n):
        ans[i] = '%.6f' % solve(1 << i)
    return ans

